import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import { AppBar, Toolbar, Button, Container } from '@mui/material';
import Leaderboard from './components/Leaderboard';
import PredictionPanel from './components/PredictionPanel';
import Rewards from './components/Rewards';
import LiveGameStats from './components/LiveGameStats';
import './index.css';

function App() {
  return (
    <Router>
      <AppBar position="static" color="primary">
        <Toolbar>
          <h1 style={{ flexGrow: 1 }}>üèÄ Rutgers Basketball</h1>
          <Button color="inherit" component={Link} to="/">Leaderboard</Button>
          <Button color="inherit" component={Link} to="/predictions">Predictions</Button>
          <Button color="inherit" component={Link} to="/rewards">Rewards</Button>
        </Toolbar>
      </AppBar>
      <Container style={{ marginTop: '20px' }}>
        <Routes>
          <Route path="/" element={<Leaderboard />} />
          <Route path="/predictions" element={<PredictionPanel />} />
          <Route path="/rewards" element={<Rewards />} />
        </Routes>
      </Container>
    </Router>
  );
}

export default App;
